export default function Todos(props) {
    console.log(props.props)
    const todos = props.props.map(prop=>{
        return(
        <>
            <div className="todos">
                <div className="input">
                    <div className="input__inputs">
                        <h1></h1>
                    <p></p>
                </div>
            </div>
        </div>
        </>)
    })
    console.log(todos)
    return(<div>{todos}</div>);
}
